DROP TABLE IF EXISTS player_allstar;
CREATE TABLE player_allstar(
   player_id       VARCHAR(9) NOT NULL 
  ,last_name       VARCHAR(12) NOT NULL
  ,first_name      VARCHAR(11) NOT NULL
  ,season_id       INTEGER  NOT NULL
  ,conference      VARCHAR(8) NOT NULL
  ,league_id       VARCHAR(3) NOT NULL
  ,games_played    BIT  NOT NULL
  ,minutes         INTEGER  NOT NULL
  ,points          INTEGER 
  ,o_rebounds      INTEGER 
  ,d_rebounds      INTEGER 
  ,rebounds        INTEGER 
  ,assists         INTEGER 
  ,steals          INTEGER 
  ,blocks          INTEGER 
  ,turnovers       INTEGER 
  ,personal_fouls  INTEGER 
  ,fg_attempted    INTEGER 
  ,fg_made         INTEGER 
  ,ft_attempted    INTEGER 
  ,ft_made         INTEGER 
  ,three_attempted INTEGER 
  ,three_made      INTEGER 
  ,PRIMARY KEY(player_id , season_id)
);
